Check the example Queens.tla from the repository of TLA+ examples. It has 85 lines of code, so we do not include it here. Similar to the previous sections, we annotate constants and variables: CONSTANT \* @type: Int; N
... VARIABLES \* @type: Set(Seq(Int)); todo, \* @type: Set(Seq(Int)); sols After having inspected the type errors reported by Snowcat, we annotate the operators Attacks, IsSolution, and vars as follows: \* @type: (Seq(Int), Int, Int) => Bool;
Attacks(queens,i,j) == ... \* @type: Seq(Int) => Bool;
IsSolution(queens) == ... \* @type: <<Set(Seq(Int)), Set(Seq(Int))>>;
vars == <<todo,sols>> Now we run the type checker and receive the following type error: [Queens.tla:47:21-47:38]: Mismatch in argument types.
Expected: ((Seq(Int)) => Bool) Let's have a closer look at the problematic operator definition of Solutions: Solutions == { queens \in [1..N -> 1..N]: IsSolution(queens) } This looks funny: IsSolution is expecting a sequence, whereas Solutions is clearly producing a set of functions. Of course, it is not a problem in the untyped TLA+. In fact, it is a well-known idiom: Construct a function by using function operators and then apply sequence operators to it. In Apalache we have to explicitly write that a function should be reinterpreted as a sequence. To this end, we have to use the operator FunAsSeq from the module Apalache.tla . Hence, we add Apalache to the EXTENDS clause and apply the operator FunAsSeq as follows: EXTENDS Naturals, Sequences, Apalache
...
Solutions == LET Queens == { queens \in [1..N -> 1..N] : FunAsSeq(queens, N) } IN { FunAsSeq(queens, N): queens \in Queens } This time the type checker can find the types of all expressions: > Your types are great!

