Notation: { x \in S: P } LaTeX notation: filter Arguments: Three arguments: a variable name (or a tuple of names, see Advanced syntax ), a set, and an expression. Apalache type: The formal type of this operator is a bit complex. Hence, we give an informal description: x has the type a, for some type a, S has the type Set(a), P has the type Bool, the expression { x \in S: P } has the type Set(a). Effect: This operator constructs a new set F as follows. For every element e of S, do the following (we give a sequence of steps to ease the understanding): Bind the element e to variable x, Evaluate the predicate P, If P evaluates to TRUE under the binding [x |-> e], then insert the element of e into set F. Determinism: Deterministic. Errors: Pure TLA+ does not restrict the operator arguments. TLC flags a model checking error, if S is infinite. Apalache produces a static type error, if the type of elements of S is not compatible with the type of x as expected in P. Advanced syntax: Instead of a single variable x, one can use a tuple syntax to unpack variables from a Cartesian product, see Tuples . For instance, one can write { <<x, y>> \in S: P }. In this case, for every element e of S, the variable x is bound to e[1] and y is bound to e[2]. The filter expression constructs the set of elements (tuples) that make P evaluate to TRUE. Example in TLA+: { x \in {1, 2, 3, 4}: x > 2 } \* { 3, 4 } { x \in {1, 2, 3, 4}: x > 10 } \* { } \* check the section on tuples to understand the following syntax { <<x, y>> \in (1..4) \X (1..4): y = 3 } \* {<<1, 3>>, <<2, 3>>, <<3, 3>>, <<4, 3>>} Example in Python: Python conveniently offers us the set comprehension syntax: >>> S = {1, 2, 3, 4}
>>> { x for x in S if x > 2 }
{3, 4}
>>> { x for x in S if x > 10 }
set()
>>> S2 = {(x, y) for x in S for y in S}
