This operator causes a lot of confusion. Read carefully! Notation: CHOOSE x \in S: P LaTeX notation: choose-bounded Arguments: Three arguments: a variable name, a set, and an expression. Apalache type: The formal type of this operator is a bit complex. Hence, we give an informal description: x has the type a, for some type a, S has the type Set(a), P has the type Bool, the expression CHOOSE x \in S: P has the type a. Effect: This operator implements a black-box algorithm that somehow picks one element from the set {x \in S: P}. Is it an algorithm? Yes! CHOOSE x \in S: P is deterministic. When you give it two equal sets and two equivalent predicates, CHOOSE produces the same value. Formally, the only known property of CHOOSE is as follows (which is slightly more general than what we wrote above): {x \in S: P} = {y \in T: Q} => (CHOOSE x \in S: P) = (CHOOSE y \in T: Q) Importantly, when {x \in S: P} = {}, the expression CHOOSE x \ in S: P evaluates to an undefined value. How does CHOOSE actually work? TLA+ does not fix an algorithm for CHOOSE by design. Maybe it returns the first element of the set? Sets are not ordered, so there is no first element. Why should you use CHOOSE? Actually, you should not. Unless you have no other choice 🎀 There are two common use cases, where the use of CHOOSE is well justified: Use case 1: Retrieving the only element of a singleton set. If you know that Cardinality({x \in S: P}) = 1, then CHOOSE x \in S: P returns the only element of {x \in S: P}. No magic. For instance, see: Min and Max in FiniteSetsExt . Use case 2: Enumerating set elements in a fixed but unknown order. For instance, see: ReduceSet in FiniteSetsExt . In other cases, we believe that CHOOSE is bound to do Program synthesis . So TLC does some form of synthesis by brute force when it has to evaluate CHOOSE. Determinism: Deterministic. Very much deterministic. Don't try to model non-determinism with CHOOSE. For non-determinism, see: Control Flow and Non-determinism . Apalache picks a set element that satisfies the predicate P, but it does not guarantee the repeatability property of CHOOSE. It does not guarantee non-determinism either. Interestingly, this behavior does not really make a difference for the use cases 1 and 2. If you believe that this causes a problem in your specification, open an issue... Errors: Pure TLA+ does not restrict the operator arguments. TLC flags a model checking error, if S is infinite. Apalache produces a static type error, if the type of elements of S is not compatible with the type of x as expected in P. Example in TLA+: CHOOSE x \in 1..3: x >= 3 \* 3 CHOOSE x \in 1..3: \A y \in 1..3: y >= x \* 1, the minimum CHOOSE f \in [ 1..10 -> BOOLEAN ]: \E x, y \in DOMAIN f: f[x] /\ ~f[y] \* some Boolean function from 1..10 that covers FALSE and TRUE Example in Python: Python does not have anything similar to CHOOSE. The closest possible solution is to sort the filtered set by the string values and pick the first one (or the last one). So we have introduced a particular way of implementing CHOOSE, see choose.py : # A fixed implementation of CHOOSE x \in S: TRUE
# that sorts the set by the string representation and picks the head
def choose(s): lst = sorted([(str(e), e) for e in s], key=(lambda pair: pair[0])) (_, e) = lst[0] return e if __name__ == "__main__": s = { 1, 2, 3} print("CHOOSE {} = {}".format(s, choose(s))) s2 = { frozenset({1}), frozenset({2}), frozenset({3})} print("CHOOSE {} = {}".format(s2, choose(s2)))

